  [],\n\t\"revision_timestamp\": \"2014-09-02T23:01:05.735284\",\n\t\"name\": \"contour-farming-on-agricultural-land-in-the-conterminous-united-states-1992-national-resour-330\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set represents the estimated
  percentage of the 1-km grid cell that is covered by or subject to the agricultural
  conservation practice (CP330), Contour Farming (CF) on agricultural land by county.
  Contour Farming is described as \"tillage, planting, and other farming operations
  performed on or near the contour of the field slope.\" (U.S. Department of Agriculture,
  1995) This data set was created with geographic information systems (GIS) and database
  management tools. The acres on which CF's are applied were totaled at the county
  level in the tabular NRI database and then apportioned to a raster coverage of agricultural
  land within the county based on the Enhanced National Land Cover Dataset (NLCDe)
  1-kilometer resolution land cover grids (Nakagaki, 2003). Federal land is not considered
  in this analysis because NRI does not record information on those lands.\",\n\t\"license_title\":
